        img: 'team1.png',
        name: '–ë–æ–ª–∞—Ç',
        title: 'Mean Stack —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫'
    },{
        text: 'Decode –≤—ã–±—Ä–∞–ª–∞ –Ω–µ —è, –∞ –º–æ–∏ —Ä–æ–¥–∏—Ç–µ–ª–∏, –Ω–æ —è –æ—á–µ–Ω—å —Ä–∞–¥–∞, —á—Ç–æ –ø–æ–ø–∞–ª–∞ –∏–º–µ–Ω–Ω–æ —Å—é–¥–∞. –û–±—É—á–µ–Ω–∏–µ –¥–∞–ª–æ –∫–∞–∫–æ–π-—Ç–æ –Ω–µ–≤–∏–¥–∏–º—ã–π –ø–∏–Ω–æ–∫ –∫ –±–æ–ª–µ–µ —É–≥–ª—É–±–ª–µ–Ω–Ω–æ–º—É –∏–∑—É—á–µ–Ω–∏—é –≤—Å–µ–≥–æ —ç—Ç–æ–≥–æ –¥–µ–ª–∞. –î–∞ –∏ –∏–Ω—Ç–µ—Ä–µ—Å–∞ –±–æ–ª—å—à–µ —Å—Ç–∞–ª–æ. –ù–∞—É—á–∏–ª–æ –≤—Å–µ–º –∞–∑–∞–º, –Ω–∞–≤–µ—Ä–Ω–æ–µ. –ò –ø–æ–º–æ–≥–ª–æ –º–Ω–µ —Ä–∞–∑–æ–±—Ä–∞—Ç—å—Å—è –≤ —ç—Ç–æ–º –±–æ–ª–µ–µ –ø–æ–¥—Ä–æ–±–Ω–æ. –°–µ–π—á–∞—Å —è –¥–æ–¥–µ–ª—ã–≤–∞—é –ø—Ä–æ–µ–∫—Ç, –∫–æ—Ç–æ—Ä—ã–π –±—ã–ª —Ñ–∏–Ω–∞–ª—å–Ω—ã–º. –ò–∑-–∑–∞ –Ω–µ—Ö–≤–∞—Ç–∫–∏ –≤—Ä–µ–º–µ–Ω–∏ –æ–Ω –±—ã–ª –µ—â–µ ¬´—Å—ã—Ä–æ–π¬ª –∏ —Å–æ–≤—Å–µ–º –Ω–µ–¥–æ—Ä–∞–±–æ—Ç–∞–Ω–Ω—ã–π, –Ω–æ —Å–µ–π—á–∞—Å –æ–Ω –±–æ–ª–µ–µ –∏–≥—Ä–∞–±–µ–ª—å–Ω—ã–π. ',
        img: 'team1.png',
        name: '–ê—Ñ–∏–Ω–∞',
        title: 'Unity —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫'
    },{
        text: '–ú–Ω–µ 16 –ª–µ—Ç –∏ —è —É—á—É—Å—å –Ω–∞ 2 –∫—É—Ä—Å–µ –∫–æ–ª–ª–µ–¥–∂–∞ ITüë©‚Äçüíª –° –¥–µ—Ç—Å—Ç–≤–∞ –º–µ—á—Ç–∞–ª–∞ –æ –ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏–∏, –ø–æ—ç—Ç–æ–º—É –ø–æ—Å—Ç—É–ø–∏–ª–∞ –≤ –∫–æ–ª–ª–µ–¥–∂. –í –≤—ã–±–æ—Ä–µ —Å–ø–µ—Ü–∏–∞–ª—å–Ω–æ—Å—Ç–∏ –º–Ω–µ –ø–æ–º–æ–≥ –±—Ä–∞—Ç‚úä –ö–æ–≥–¥–∞ –≤–ø–µ—Ä–≤—ã–µ —É–≤–∏–¥–µ–ª–∞ —Ä–µ–∫–ª–∞–º—É Decode, —Å—Ä–∞–∑—É –∂–µ –∑–∞—Ö–æ—Ç–µ–ª–∞ –∑–∞–ø–∏—Å–∞—Ç—å—Å—è, –∞ –∫–æ–≥–¥–∞ –ø—Ä–∏—à–ª–∞ –≤ —à–∫–æ–ª—É, –º–Ω–µ –ø–æ–Ω—Ä–∞–≤–∏–ª–æ—Å—å –≤—Å—ë: –∏ —É—á–∏—Ç–µ–ª—è –æ—á–µ–Ω—å –∫–ª–∞—Å—Å–Ω—ã–µ –∏ –∞—Ç–º–æ—Å—Ñ–µ—Ä–∞ —Ç–æ–∂–µüòä –†–∞–Ω—å—à–µ –Ω–µ —Ö–æ—Ä–æ—à–æ —Ä–∞–∑–±–∏—Ä–∞–ª–∞—Å—å –≤ —ç—Ç–∏—Ö –∫–æ–¥–∞—Ö, –Ω–æ –ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ –ø—Ä–∏—à–ª–∞ —Å—é–¥–∞, —è –Ω–∞—á–∞–ª–∞ –ø–æ–Ω–∏–º–∞—Ç—å —á—Ç–æ —Ç–∞–∫–æ–µ –ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏–µüòç',
        img: 'team1.png',
        name: '–î–∏–Ω–∞',
        title: '–°++ —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫'
    },{
        text: '–í—Å–µ–º –ø—Ä–∏–≤–µ—Ç! –í—ã–±—Ä–∞–ª–∞ —à–∫–æ–ª—É Decode, –ø–æ—Ç–æ–º—É —á—Ç–æ –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–µ –Ω–∞—É—á–∏—Ç—å—Å—è –æ—Å–Ω–æ–≤–∞–º –≤–µ–±-–ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏—è —Å –Ω—É–ª—è –∑–∞ —Ç–∞–∫–æ–µ –∫–æ—Ä–æ—Ç–∫–æ–µ –≤—Ä–µ–º—è –ø–æ–∫–∞–∑–∞–ª–æ—Å—å –∑–∞–º–∞–Ω—á–∏–≤—ã–º. –û–Ω–∏ –Ω–µ –ø–æ–¥–≤–µ–ª–∏‚ò∫Ô∏è –Ø –Ω–∞—É—á–∏–ª–∞—Å—å –æ—á–µ–Ω—å –º–Ω–æ–≥–æ–º—É. –ü–æ–ª—é–±–∏–ª–∞ javascriptü§ì –ü–æ–Ω—è–ª–∞ –ø—Ä–∏–Ω—Ü–∏–ø —Ä–∞–±–æ—Ç—ã —Å–∞–π—Ç–æ–≤ –∏ —Ä–∞–∑–ª–∏—á–∏–µ –º–µ–∂–¥—É –¥–µ–π—Å—Ç–≤–∏—Ç–µ–ª—å–Ω–æ –∫—Ä—É—Ç—ã–º–∏ —Å–∞–π—Ç–∞–º–∏ –∏ –Ω–µ –æ—á–µ–Ω—åüòå‚†Ä–°–µ–π—á–∞—Å —Ä–∞–±–æ—Ç–∞—é front-end —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫–æ–º –≤ –∫–æ–º–ø–∞–Ω–∏–∏ –¢–û–û "Aida Service. –ò —è –ø—Ä–∞–≤–¥–∞ –±–ª–∞–≥–æ–¥–∞—Ä–Ω–∞ –Ω–µ —Ç–æ–ª—å–∫–æ –∑–∞ –∑–Ω–∞–Ω–∏—è',
        img: 'team1.png',
        name: '–ë–æ–ª–∞—Ç',
        title: 'Mean Stack —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫'
    }]
    return (
        <div className="reviews">
            <h2>–ß—Ç–æ –≥–æ–≤–æ—Ä—è—Ç –æ –Ω–∞—Å</h2>
            {reviews.map(review=>(
                <ReviewInfo text = {review.text} img = {review.img} name = {review.name} title = {review.title} />
            ))}

        </div>

    )
}

export default Review;
